import React, {useState, useEffect} from 'react';
import Togglebutton from './Togglebutton';
import './Diagnose.css'


function Diagnose(){

    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )  
    }, [])

    var letter = "a";
    return (
        <div className='Diagnose-page'>
            <h1>Select Symptoms: </h1>

            var letter = " ";

            {(typeof data === "undefined") ? (
                <p> Loading...</p>
            ) : (

                data.map((item, i) => (
                    // console.log(typeof item)
                    <div>
                        (letter!=item[0]? <p>{letter}</p>:)
                        letter = item[0];
                        <Togglebutton name={item} />
                    </div>
                ))
            )}
        </div>
    );
}

export default Diagnose;
